    public sealed partial class TileLayout : UserControl,IDisposable
    {
        ResourceDictionary res = new ResourceDictionary();
        public TileLayout()
        {
            this.InitializeComponent();
            res.Source = new Uri("ms-appx:///Syncfusion.SampleBrowser.UWP.Common/Generic.xaml", UriKind.RelativeOrAbsolute);
            this.Resources.MergedDictionaries.Add(res);
            this.Unloaded += TileLayout_Unloaded;
        }

        private void TileLayout_Unloaded(object sender, RoutedEventArgs e)
        {
            Dispose();
        }

        public void Dispose()
        {
            this.Resources.MergedDictionaries.Remove(res);
            this.Resources.MergedDictionaries.Clear();
            this.Resources.Clear();
            this.Resources = null;
            res = null;
            this.gridview.ItemClick -= GridView_ItemClick;
            this.gridview.DataContext = null;
            this.DataContext = null;
            this.gridview = null;
            this.Unloaded -= TileLayout_Unloaded;
            GC.Collect();

        }


        private void GridView_ItemClick(object sender, ItemClickEventArgs e)
        {
            FrameNavigationService.Header.Text = (e.ClickedItem as FeatureSampleCategory).Name;
            FrameNavigationService.CurrentFrame.Navigate(typeof(SampleContent), e.ClickedItem);

        }
    }

